import React from "react";

import "../../assets/css/compeounder.css";
import "../../assets/css/innerstyle.css";
import "../../assets/css/bootstrap/dist/css/bootstrap.min.css"; 

const  EbookPage = () => {
  
  return (
    <div
      className="tab-pane fade show active"
      id="KeyWebsite"
      role="tabpanel"
      aria-labelledby="KeyWebsite-tab"
    >
      <div className="owl-carousel" id="resourcesOwl1">
        {cardData.map((card) => (
          <div className="KeyWebsiteCard" key={card.id}>
            <figure>
              <a href="#">
                <img src={card.imgSrc} alt={card.title} title={card.title} />
              </a>
            </figure>
            <div className="KeyWebsiteCardDate">
              <i className="fa-solid fa-calendar-days"></i>
              <span>{card.date}</span>
            </div>
            <h4>
              <a href="#">{card.title}</a>
            </h4>
            <div className="KeyWebsiteCardContent">
              <p>Lorem Ipsum is simply dummy text of the printing and typesetting industry.</p>
            </div>
            <a href="#" className="readmoreBtn">
              <span>Read More</span>
            </a>
          </div>
        ))}
      </div>
    </div>
  );
};

export default EbookPage;
